import axios from "axios";
import React from "react";
export default class Coin extends React.Component{

    constructor(props){
        super(props)
        this.state = {
            coins : []
        }
        this.componentDidMount = this.componentDidMount.bind(this) ;
    }
   
   async componentDidMount(){
    var token = "Bearer "+localStorage.getItem('token');
    console.log(token);
    let headersList = {
        "Authorization": "Bearer eyJhbGciOiJIUzI1NiJ9.eyJzdWIiOiJWTjA1MTA5OCIsImV4cCI6MTY1MDcyNDcyOCwiaWF0IjoxNjUwNjg4NzI4fQ.IxtUcureTlzF5LQL0S0H2o9TQ50Rgr-NvhQTrajWtWw",
        "Accept-Language": "application/json",
        "Authorization": "Bearer eyJhbGciOiJIUzI1NiJ9.eyJzdWIiOiJHTDAwMDAwMCIsImV4cCI6MTY1MTQ4ODk3MCwiaWF0IjoxNjUxNDUyOTcwfQ.IiaEo1IwRVvz7io3xfYdLnDRjrQDpGh1IGifM5LAn0c" 
       }
       
       let reqOptions = {
         url: "http://localhost:8089/api/coin/getAllCoin",
         method: "GET",
         headers: headersList,
       }
       
       axios.request(reqOptions).then(function (response) {
         console.log(response.data);
       })
    }
    render(){
        return (
            <div> 
            <h1>Coin List</h1>  
                <table className="table table-hover">
                    <thead>
                        <tr>
                            <th>CoinId</th>
                            <th>CoinName</th>
                            <th>Price</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                        this.state.coins.map(
                        coin =>
                        <tr key = {coin.coinId}>
                            <td>{coin.coinId}</td>
                            <td>{coin.coinName}</td>
                            <td>{coin.price}</td>
                        </tr>
                            )
                        }
                    </tbody>
            </table>
   </div>

        )
       
    }
}
